Comment:
The keyword elseif SHOULD be used instead of else if so that all control keywords look like single words. Raw is else if ($thing > 5) {
        print('World');
    } else if ($thing > 2) {
        print('Yo');
    }

Snippet:
    if ($thing > 10) {
        print('Hello');
    } else if ($thing > 5) {
        print('World');
    } else if ($thing > 2) {
        print('Yo');
    }
}

